inking 1','UWS Enterprise Academy','https://i.ytimg.com/vi/ErEMM1tF07k/mqdefault.jpg','https://www.youtube.com/watch?v=ErEMM1tF07k','ErEMM1tF07k','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6382,'Entrepreneurial thinking can change the world! Jeremy Liddle - Speaker, Consultant & Business coach','Jeremy Liddle','https://i.ytimg.com/vi/nTIGq2oGB0w/mqdefault.jpg','https://www.youtube.com/watch?v=nTIGq2oGB0w','nTIGq2oGB0w','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6383,'Entrepreneurial thinking Arcada360','ke b','https://i.ytimg.com/vi/0W23Af4HcPI/mqdefault.jpg','https://www.youtube.com/watch?v=0W23Af4HcPI','0W23Af4HcPI','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6384,'The Start-Up of YOU: Rediscovering the Entrepreneurial Spirit in All of Us','startupofyou','https://i.ytimg.com/vi/PF3zSo9jFuk/mqdefault.jpg','https://www.youtube.com/watch?v=PF3zSo9jFuk','PF3zSo9jFuk','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6385,'Annual Dinner 2013: The Impact of Entrepreneurial Thinking','Columbia Business School','https://i.ytimg.com/vi/t94cbXA3a7A/mqdefault.jpg','https://www.youtube.com/watch?v=t94cbXA3a7A','t94cbXA3a7A','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6386,'Guest Entrepreneur Speakers - Entrepreneurial Thinking','UWS School of Business & Enterprise','https://i.ytimg.com/vi/rB8c4tPiS7Q/mqdefault.jpg','https://www.youtube.com/watch?v=rB8c4tPiS7Q','rB8c4tPiS7Q','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6387,'Entrepreneurial Thinking at The Eastern Innovation Business Center','AJ Kulatunga','https://i.ytimg.com/vi/HHVpiHAirSk/mqdefault.jpg','https://www.youtube.com/watch?v=HHVpiHAirSk','HHVpiHAirSk','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6388,'Inspiring Young Entrepreneurs: Imagination, Creativity, and Entrepreneurial Thinking','GlobalMindED','https://i.ytimg.com/vi/88Bcejs-ckU/mqdefault.jpg','https://www.youtube.com/watch?v=88Bcejs-ckU','88Bcejs-ckU','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6389,'Hazel McCallion: How do you define entrepreneurial thinking?','Financial Post','https://i.ytimg.com/vi/Y5jth4tpxPA/mqdefault.jpg','https://www.youtube.com/watch?v=Y5jth4tpxPA','Y5jth4tpxPA','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6390,'Andy Goldstein - Sales - Entrepreneurial Thinking Part 5','LMU Entrepreneurship Center','https://i.ytimg.com/vi/kZBC8YnEn6g/mqdefault.jpg','https://www.youtube.com/watch?v=kZBC8YnEn6g','kZBC8YnEn6g','YouTube',0,0,'','External_Content',-1000,NULL,NULL,NULL,NULL,NULL),(6911,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'How many times have you gone to a meeting with only a vague agenda and sat through a discussion with no end in sight? Those meetings arent fun are they?The most effective meetings are ones where the objectives are clear. A simple statement of what you hope to achieve can shave an average of 17 minutes off of your meeting.','UGC',54,'#Meeting_Management',NULL,NULL,'2017-05-05 15:56:15','2017-05-05 15:56:15'),(6912,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Be Exclusive, When I get a meeting invite, Iâ€™ll usually ask (politely) if I actually need to be there. Often, office politics get in the way of who really needs to attend. Google caps attendees at 10 and Amazon has a â€œtwo pizzaâ€ rule (i.e., never have a meeting where you canâ€™t feed the whole group with two pies).','UGC',56,'#Meeting_Management',NULL,NULL,'2017-05-04 23:04:00','2017-05-04 23:04:00'),(6913,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Time It To The Second, Short well defined meetings are good. If you have a longer meeting, be clear with a broken down agenda.','UGC',60,'#Meeting_Management',NULL,NULL,'2017-05-04 23:04:20','2017-05-04 23:04:20'),(6914,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Leave A Buffer, Itâ€™s amazing how often weâ€™ll book back-to-back meetings without thinking about the logistics - the time it takes to walk from one office to the next, for instance, or to top up your coffee.','UGC',52,'#Meeting_Management',NULL,NULL,'2017-05-06 05:50:54','2017-05-06 05:50:54'),(6915,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Ditch PowerPoint, At Amazon, Jeff Bezos banned PowerPoint outright. Too often, weâ€™re stuck listening to a presenter read an entire slideshow, verbatim. Visuals can be a great tool, but if youâ€™re using PowerPoint as a crutch, your meeting is going to feel like itâ€™s on life support.','UGC',56,'#Meeting_Management',NULL,NULL,'2017-05-06 05:49:43','2017-05-06 05:49:43'),(6916,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Provide Some Entertainment\n\nSome people might hear â€œicebreakerâ€ and groan, but a round-table question gets the conversation going.','UGC',54,'#Meeting_Management',NULL,NULL,'2017-05-08 07:40:26','2017-05-08 07:40:26'),(6917,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Unplug Your Laptops\n\nStudies have found that students who use laptops have a harder time remembering what they learn in lectures and are less likely to understand complex ideas; the same goes for the office.','UGC',53,'#Meeting_Management',NULL,NULL,'2017-05-04 23:05:31','2017-05-04 23:05:31'),(6918,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Meet Face-to-Face\n\nHow many conference calls have you tuned out of? Iâ€™m guilty of it, too: letting my mind wander when Iâ€™m not physically in the room. One study found revealed that 65% of employees regularly do other work while a conference call is happening. (A full 47% have even gone to the washroom during a call).','UGC',57,'#Meeting_Management',NULL,NULL,'2017-05-06 05:49:04','2017-05-06 05:49:04'),(6919,NULL,NULL,NULL,NULL,NULL,'Text',0,20,'Lead With Purpose\n\nGreat meetings happen when you have great leaders. Itâ€™s not always easy to be the one ensuring things are moving along, but someone has to be accountable for running meetings that donâ€™t suck.','UGC',56,'#Meeting_Management',NULL,NULL,'2017-05-08 07:50:47','2017-05-08 07:50:47'),(6920,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Opening Communication, In many interpersonal encounters, the first few minutes are extremely important as first impressions have a significant impact on the success of further communication.','UGC',53,'#Verbal_Communication',NULL,NULL,'2017-05-08 19:24:35','2017-05-08 19:24:35'),(6921,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Reinforcement\nThe use of encouraging words alongside non-verbal gestures such as head nods, a warm facial expression and maintaining eye contact, are more likely to reinforce openness in others. \n\nThe use of encouragement and positive reinforcement can, Encourage others to participate in discussion (particularly in group work)','UGC',54,'#Verbal_Communication',NULL,NULL,NULL,NULL),(6922,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Effective Listening\nActive listening is an important skill and yet, as communicators, people tend to spend far more energy considering what they are going to say rather than listening to what the other person is trying to say.\n\nAlthough active listening is a skill in itself, covered in depth on our listening pages, it is also vital for effective verbal communication.','UGC',58,'#Verbal_Communication',NULL,NULL,'2017-05-08 00:14:57','2017-05-08 00:14:57'),(6923,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Questioning\nEffective questioning is an essential skill.  Questioning can be used to:\n\nObtain information.\nStart a conversation.\nTest understanding.\nDraw someone into a conversation.\nShow interest in a person.\nSeek support or agreement.','UGC',52,'#Verbal_Communication',NULL,NULL,'2017-05-08 19:23:48','2017-05-08 19:23:48'),(6924,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Closed Questions\nClosed questions tend to seek only a one or two word answer (often simply yes or no) and, in doing so, limit the scope of the response. Two examples of closed questions are Did you travel by car today? and Did you see the football game yesterday? These types of question mean control of the communication is maintained by the questioner yet this is often not the desired outcome when trying to encourage verbal communication.','UGC',52,'#Verbal_Communication',NULL,NULL,'2017-05-08 07:57:38','2017-05-08 07:57:38'),(6925,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Open Questions\nOpen questions broaden the scope for response since they demand further discussion and elaboration. For example, What was the traffic like this morning? or What do you feel you would like to gain from this discussion? Open questions will take longer to answer, but they do give the other person far more scope for self-expression and encourage involvement in the conversation.','UGC',55,'#Verbal_Communication',NULL,NULL,'2017-05-08 07:57:20','2017-05-08 07:57:20'),(6926,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Reflecting and Clarifying\nReflecting is the process of feeding-back to another person your understanding of what has been said. Although reflecting is a specialised skill used within counselling, it can also be applied to a wide range of communication contexts and is a useful skill to learn.','UGC',52,'#Verbal_Communication',NULL,NULL,'2017-05-08 14:48:13','2017-05-08 14:48:13'),(6927,NULL,NULL,NULL,NULL,NULL,'Text',0,21,'Closing Communication\nThe way a communication is closed or ended will, at least in part, determine the way a conversation is remembered.','UGC',52,'#Verbal_Communication',NULL,NULL,'2017-05-05 14:37:03','2017-05-05 14:37:03'),(6928,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Face the speaker and maintain eye contact.\nTalking to someone while they scan the room, study a computer screen, or gaze out the window is like trying to hit a moving target. How much of the persons divided attention you are actually getting? Fifty percent? Five percent? If the person were your child you might demand, Look at me when Im talking to you,','UGC',54,'#Listening',NULL,NULL,'2017-05-08 00:20:04','2017-05-08 00:20:04'),(6929,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Be attentive, but relaxed.\nNow that youve made eye contact, relax. You dont have to stare fixedly at the other person. You can look away now and then and carry on like a normal person. The important thing is to be attentive. The dictionary says that to attend another person means to:\n\nbe present\ngive attention\napply or direct yourself\npay attention\nremain ready to serve','UGC',54,'#Listening',NULL,NULL,'2017-05-07 16:50:43','2017-05-07 16:50:43'),(6930,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Keep an open mind.\nListen without judging the other person or mentally criticizing the things she tells you. If what she says alarms you, go ahead and feel alarmed, but dont say to yourself, Well, that was a stupid move. As soon as you indulge in judgmental bemusements, youve compromised your effectiveness as a listener.','UGC',53,'#Listening',NULL,NULL,'2017-05-07 16:51:49','2017-05-07 16:51:49'),(6931,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Listen to the words and try to picture what the speaker is saying.\nAllow your mind to create a mental model of the information being communicated. Whether a literal picture, or an arrangement of abstract concepts, your brain will do the necessary work if you stay focused, with senses fully alert. When listening for long stretches, concentrate on, and remember, key words and phrases.','UGC',52,'#Listening',NULL,NULL,'2017-05-08 00:20:20','2017-05-08 00:20:20'),(6932,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Dont interrupt and dont impose your solutions.\nChildren used to be taught that its rude to interrupt. Im not sure that message is getting across anymore. Certainly the opposite is being modeled on the majority of talk shows and reality programs, where loud, aggressive, in-your-face behavior is condoned, if not encouraged.','UGC',53,'#Listening',NULL,NULL,NULL,NULL),(6933,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Wait for the speaker to pause to ask clarifying questions.\nWhen you dont understand something, of course you should ask the speaker to explain it to you. But rather than interrupt, wait until the speaker pauses. Then say something like, Back up a second. I didnt understand what you just said aboutâ€¦','UGC',54,'#Listening',NULL,NULL,'2017-05-07 16:50:52','2017-05-07 16:50:52'),(6934,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Ask questions only to ensure understanding.\nAt lunch, a colleague is excitedly telling you about her trip to Vermont and all the wonderful things she did and saw. In the course of this chronicle, she mentions that she spent some time with a mutual friend. You jump in with, Oh, I havent heard from Alice in ages. How is she? and, just like that, discussion shifts to Alice and her divorce, and the poor kids, which leads to a comparison of custody laws, and before you know it an hour is gone and Ver','UGC',54,'#Listening',NULL,NULL,'2017-05-06 02:13:46','2017-05-06 02:13:46'),(6935,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Try to feel what the speaker is feeling.\nIf you feel sad when the person with whom you are talking expresses sadness, joyful when she expresses joy, fearful when she describes her fearsâ€”and convey those feelings through your facial expressions and wordsâ€”then your effectiveness as a listener is assured. Empathy is the heart and soul of good listening.','UGC',52,'#Listening',NULL,NULL,'2017-05-06 02:15:38','2017-05-06 02:15:38'),(6936,NULL,NULL,NULL,NULL,NULL,'Text',0,22,'Give the speaker regular feedback.\nShow that you understand where the speaker is coming from by reflecting the speakers feelings. You must be thrilled! What a terrible ordeal for you. I can see that you are confused. If the speakers feelings are hidden or unclear, then occasionally paraphrase the content of the message. Or just nod and show your understanding through appropriate facial expressions and an occasional well-timed hmmm or uh huh.','UGC',52,'#Listening',NULL,NULL,'2017-05-07 16:51:54','2017-05-07 16:51:54'),(6937,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Research your audience. Knowing the needs of your audience can help you tailor your presentation to target their interests and explain how your company can be of use in their specific situation.','UGC',52,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6938,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Structuring your presentation. The classic format is to tell them what youre going to say, present, and then tell them what you told them,','UGC',50,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6939,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Opening - Your opening should be something that makes an emotional connection with the audience.  It can be a story, a question, or a shocking static. It should not be an introduction of yourself or five minutes of thank-yous. David Parnell, the founder of an attorney placement firm who recently finished an 850-page book on the psychology of effective communication, suggests that any stories you use should represent your audiences position in life and should use characters that are analogous to ','UGC',50,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6940,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Body - Try to stick to your three most important points. Its more important to engage the audience than to tell them everything you know. You will need to leave some information out, but it is likely that what you dont cover in the presentation will come up when you take questions. Keep your outcome in mind. You dont have to write out your presentation word for word (or worse, memorize it) if you just remember to keep going back to your main points and working toward your desired outcome. Be pre','UGC',51,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6941,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Closing - The closing of your presentation is the last opportunity you have to give your audience something that will stick in their minds. You can go back to your opening or end on a clever slogan or a call to action.','UGC',55,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6942,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Practice, practice, practiceâ€¦but dont memorize. Its different for everybody, but I will say one thing: If you practice your speech only once, youre going to stink, Braithwaite says. She recommends starting to rehearse your presentation about a month in advance. You can talk into a mirror, talk to a wall, or ask a family member to listen.','UGC',51,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6943,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Rehearsing does not mean memorization - Memorizing your speech can make you sound mechanical and over-rehearsed. Really the only people who are good at memorizing things are actors, Braithwaite says. if youre going to do it well, you actually have to act it out and play a character, and most speakers arent very good at that. Even if you are good at acting, Parnell suggests that you dont memorize your speech to perfection.','UGC',53,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6944,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Videotape yourself - You cant know how you come off to people until you see it. Recording yourself is the best way to target the areas where you can improve.','UGC',50,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6945,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Calm your nerves - Aguilera suggests changing the word presentation to conversation when thinking about your big day. Feel better yet? If not, you can also quell panic by conditioning yourself to be in presentation-mode.','UGC',50,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6946,NULL,NULL,NULL,NULL,NULL,'Text',0,23,'Stop working on it - You really need time to start getting into relaxation mode, Braithwaite says. You cant be in your hyper rewriting, restructuring mode right up to your presentation. Take a couple of days to relax before your speech','UGC',50,'#Presentation_Skills',NULL,NULL,NULL,NULL),(6947,NULL,NULL,NULL,NULL,NULL,'Text',0,24,'Storytelling is the art of taking a story,  your story or anotherâ€™s and retelling that story.','UGC',68,'#Storytelling',NULL,NULL,'2017-05-05 06:16:03','2017-05-05 06:16:03'),(6948,NULL,NULL,NULL,NULL,NULL,'Text',0,24,'Telling your story is not like writing an essay as you were taught in school. Donâ€™t mention what is to be said, then say it, then recap. With the traditional method of setting out the content of what is to be mentioned the story is over before youâ€™ve started, there is no drama, you know how it is going to end.','UGC',61,'#Storytelling',NULL,NULL,'2017-05-05 06:17:27','2017-05-05 06:17:27'),(6949,NULL,NULL,NULL,NULL,NULL,'Text',0,24,'Instead create an anecdote that builds the story, event by event as it happened.  Ideally a great story will have a variation on these elements:\n\nBeginning â€“ sets the stage\nBody â€“ starts and builds the story\nSequence of events â€“ helps to create a story\nBait â€“ Constantly raising questions(where is this going?) and answering them in a reflective way\nClimax â€“ story builds to a high point\nResolution â€“ the punch line results in the reflection on the story','UGC',58,'#Storytelling',NULL,NULL,'2017-05-05 06:17:38','2017-05-05 06:17:38'),(6950,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,'Handling angry customers, when the servers go down','UGC',6,'',NULL,NULL,NULL,NULL),(6951,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,'l','UGC',5,'',NULL,NULL,NULL,NULL),(6952,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,'New test concept','UGC',5,'',NULL,NULL,NULL,NULL),(6953,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,NULL,'UGC',5,NULL,NULL,NULL,NULL,NULL),(6954,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,'restart','UGC',5,'',NULL,NULL,NULL,NULL),(6955,NULL,NULL,'image_uploaded_from_ios.jpg',NULL,NULL,'Text',0,NULL,NULL,'UGC',5,NULL,NULL,NULL,NULL,NULL),(6956,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,NULL,'UGC',5,NULL,NULL,NULL,NULL,NULL),(6957,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,'Creating a new project for our customers','UGC',5,'',NULL,NULL,NULL,NULL),(6958,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,NULL,'UGC',5,NULL,NULL,NULL,NULL,NULL),(6959,NULL,NULL,NULL,NULL,NULL,'Text',0,NULL,NULL