INSERT INTO `curiousWorkbench_messagelibrary` VALUES ('msg_WelcomeMessage_1',1,'Text','Hi {{USER_NAME}} , Its great to meet you,||Hi {{USER_NAME}}, {{GREETING_TIME_OF_DAY}} , I am excited to be here','','','','',1,1,NULL,NULL,NULL,NULL),('msg_WelcomeMessage_2',1,'Text','I am Walnut, I help you learn concepts you need to know.\r\nEach time I will ask you a question and then share the concept behind it, Simple right ?\r\nSee topics available to you here http://test.walnutai.com/topics','','','','',2,2,NULL,NULL,NULL,NULL),('msg_WelcomeMessage_3',1,'Image','','http://test.walnutai.com/static/curiousWorkbench/images/quickOverview.png','','','',3,3,NULL,NULL,NULL,NULL),('msg_askUserLocation',1,'Text','Your location helps me find skills wanted by companies near you. Give me a Zip code . Eg: 94404','','','','',4,4,NULL,NULL,NULL,NULL),('msg_ackUserLocation',1,'Text','Thats [[actionGetLocationFromPin]]','','','','',5,6,NULL,NULL,NULL,NULL),('msg_askUserRole',1,'Text','Tell me your role , for instance you may say \"Product Manager\", \"Student\" etc','','','','',6,7,NULL,NULL,NULL,NULL),('msg_askUserCompany',1,'Text','And where do you work at ? Eg: Google Inc ','','','','',7,9,NULL,NULL,NULL,NULL),('msg_ackUserInfo',1,'Text','Awesome, Thats good for now.','','','','',8,11,NULL,NULL,NULL,NULL),('msg_analyzeSkillInfo',1,'Text','Let us spend a few minutes everyday to learn about a skill relevant for you. ','','','','text:Lets do it:CONFIRM_NOTIFICATION_TIME,text:No thanks:SHOW_OPTIONS',9,36,NULL,NULL,NULL,NULL),('msg_roleDemandInfo',1,'Text','[[actionGetRoleDemandInfo]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Lets Self Eval:SELF_EVAL_SKILLS:P, More:SHOW_OPTIONS:P','',10,12,NULL,NULL,NULL,NULL),('msg_askSelfEvalSkills',1,'Buttons','Rate your self on Product Market Fit','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','I use it every day:RECORD_SKILL_EVAL:P,I am aware:RECORD_SKILL_EVAL:P,not sure:RECORD_SKILL_EVAL:P','',11,13,NULL,NULL,NULL,NULL),('msg_ackSkillInfo',1,'Text','Got It! ','','','','',12,15,NULL,NULL,NULL,NULL),('msg_showOptions',1,'Text','Here are a few things you could do. Say Show Skills, Show Insight, Show Progress','','','','text:show me a skill:SHOW_RECO,text:show me an insight:SHOW_SKILL_STAT',13,17,NULL,NULL,NULL,NULL),('msg_ShowReco',1,'Buttons','[[actionGetReco]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Learn something new:SHOW_RECO:P, my skills :ROLE_DEMAND_INFO:P, check progress:SHOW_SKILLS:P','',14,18,NULL,NULL,NULL,NULL),('msg_SearchEventsAsk',1,'Text','Enter a topic to search','','','','',15,19,NULL,NULL,NULL,NULL),('msg_ShowRecoSingle',1,'Buttons','[[actionGetSingleReco]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Next:SHOW_RECO:P, More:WELCOME_INIT_1:P,share::S','',16,20,NULL,NULL,NULL,NULL),('msg_SearchContent',1,'Buttons','[[actionGetSearch]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Next:SHOW_RECO:P, More:SHOW_OPTIONS:P,share::S','',17,22,NULL,NULL,NULL,NULL),('msg_recordEvalSkill',1,'Text','Ok , I have made a note, Lets work on that','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','','',18,23,NULL,NULL,NULL,NULL),('msg_checkProgress',1,'Text','[[actionGetUserProgress]]','','','','',19,24,NULL,NULL,NULL,NULL),('msg_introduction',1,'Buttons','Lets get started','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','ok:WELCOME_INIT_1:P','',20,25,NULL,NULL,NULL,NULL),('msg_introduce_2',1,'Text','na','','','','',21,26,NULL,NULL,NULL,NULL),('msg_restart',1,'Text','ok, Let start all over again','','','','',22,27,NULL,NULL,NULL,NULL),('msg_showQuestions',1,'Buttons','[[ac