eeting efficient, help you achieve the goal and keep the meeting short.','','','','text:Leave:CLEAR_CREATE_TOPIC',60,71,NULL,NULL,'2017-05-08 17:18:45','2017-05-08 17:18:45'),('msgAskOptionRight',0,'Text','Give me the right answer\r\nExample: How do you do this?','','','','text:Leave Create Topic:CLEAR_CREATE_TOPIC',61,73,NULL,NULL,'2017-05-08 17:15:00','2017-05-08 17:15:00'),('msgAskOptionWrong',0,'Text','Now a upto 3 wrong answers , separate them by a comma.\r\nExample: Answer A, Answer B, Answer C','','','','text:Leave Create Topic:CLEAR_CREATE_TOPIC',62,75,NULL,NULL,'2017-05-08 17:14:19','2017-05-08 17:14:19'),('msgCompleteChallenge',0,'Text','Super! you are done, lets try it ','','','','',65,77,NULL,NULL,NULL,NULL),('msg_RunChallenge',0,'Text','[[actionGetChallenge]]','','','','',67,88,NULL,NULL,NULL,NULL),('msg_CheckChallengeAns',0,'Text','[[actionCheckChallengeAns]]','','','','',68,89,NULL,NULL,NULL,NULL),('msg_ActionAskChallengeQuestion',0,'Text','Now, Lets ask a question\r\n*Example: *\r\nWhich of these steps helps you keep meetings short','','','','text:Leave Create Topic:CLEAR_CREATE_TOPIC',69,90,NULL,NULL,'2017-05-08 17:12:15','2017-05-08 17:12:15'),('msg_WaitingMessage',0,'Text','Let me see what I can find','','','','',70,92,NULL,NULL,NULL,NULL),('msg_askTagSearch',0,'Text','What shall I look for, give me a topic like - Presentation','','','','',71,93,NULL,NULL,'2017-05-04 23:59:13','2017-05-04 23:59:13'),('msg_ShowTagSearch',0,'Buttons','[[actionGetSearch]]','','','','',72,94,NULL,NULL,NULL,NULL),('msg_TestChallenge',0,'Text','[[actionTestChallenge]]','','','','',73,95,NULL,NULL,NULL,NULL),('msg_DeleteChallenge',0,'Text','[[actionDeleteChallenge]]','','','','',74,97,NULL,NULL,NULL,NULL),('msg_ShareChallenge',0,'Text','[[actionShareChallenge]]','','','','',75,98,NULL,NULL,NULL,NULL),('',0,'','','','','','',76,105,NULL,NULL,NULL,NULL),('',0,'Text','A few things you can do right now\r\nExplore :  You can pick from a list of topics\r\nCreate a 101: Create 